import { keysOf } from "src/runtime/index";
/**
 * **isIndexable**(value)
 *
 * Type guard which validates that the value passed in can be _indexed_
 */
export function isIndexable(value) {
    return Array.isArray(value) || (typeof value === "object" && keysOf(value).length > 0)
        ? true
        : false;
}
